#рЃЉрЃўрЃќрЃюрЃћрЃАрЃАрЃўрЃљрЃ«рЃџрЃћрЃћрЃЉрЃў bm.ge-рЃАрЃњрЃљрЃю / 29.03.2023
- рЃЉрЃўрЃќрЃюрЃћрЃАрЃАрЃљрЃЏрЃўрЃбрЃў "рЃЏрЃћрЃарЃўрЃбрЃЮ", рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћ рЃЏрЃЮрЃЋрЃџрЃћрЃюрЃћрЃЉрЃўрЃЊрЃљрЃю рЃњрЃљрЃЏрЃЮрЃЏрЃЊрЃўрЃюрЃљрЃарЃћ, 6 рЃўрЃЋрЃюрЃўрЃАрЃўрЃА рЃюрЃљрЃфрЃЋрЃџрЃљрЃЊ 19 рЃўрЃЋрЃџрЃўрЃАрЃА рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃћрЃЉрЃљ;
- РђюрЃћрЃЋрЃарЃЮрЃърЃљ рЃАрЃбрЃљрЃЉрЃўрЃџрЃБрЃарЃЮрЃЉрЃљрЃљ, рЃЌрЃБ рЃЦрЃЋрЃћрЃДрЃљрЃюрЃљрЃерЃў рЃАрЃбрЃљрЃЉрЃўрЃџрЃБрЃарЃЮрЃЉрЃљ рЃљрЃа рЃўрЃЦрЃюрЃљ, рЃЏрЃљрЃерЃўрЃю рЃЉрЃўрЃќрЃюрЃћрЃАрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљрЃќрЃћ рЃАрЃљрЃБрЃЉрЃљрЃарЃў рЃќрЃћрЃЊрЃЏрЃћрЃбрЃўрЃљРђЮ-рЃарЃћрЃќрЃЮ рЃЋрЃљрЃерЃљрЃЎрЃўрЃФрЃћ;
- "рЃљрЃарЃЏрЃљрЃбрЃБрЃарЃљ рЃћрЃарЃЌ рЃЊрЃдрЃћрЃерЃў 200 рЃџрЃљрЃарЃќрЃћ рЃЏрЃћрЃбрЃўрЃЌ рЃњрЃљрЃФрЃЋрЃўрЃарЃЊрЃљ", - рЃЎрЃБрЃюрЃћрЃџрЃљрЃБрЃарЃў рЃџрЃљрЃарЃўрЃА рЃњрЃљрЃБрЃцрЃљрЃАрЃБрЃарЃћрЃЉрЃљрЃќрЃћ;
- РђюрЃўрЃюрЃЋрЃћрЃАрЃбрЃЮрЃарЃћрЃЉрЃўрЃАрЃњрЃљрЃю рЃФрЃљрЃџрЃўрЃљрЃю рЃЉрЃћрЃЋрЃарЃў рЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃА рЃЋрЃўрЃдрЃћрЃЉрЃЌ, рЃќрЃЮрЃњрЃўрЃћрЃарЃЌрЃў рЃърЃарЃЮрЃћрЃЦрЃбрЃў рЃЊрЃљрЃърЃљрЃБрЃќрЃЊрЃљРђЮ - BLB;
- "рЃАрЃљрЃЏрЃЮрЃЏрЃљрЃЋрЃџрЃЮрЃЊ, рЃЕрЃЋрЃћрЃю рЃБрЃЎрЃЋрЃћ рЃљрЃдрЃљрЃа рЃерЃћрЃњрЃЋрЃўрЃФрЃџрЃўрЃљ рЃЋрЃўрЃцрЃўрЃЦрЃарЃЮрЃЌ рЃљрЃ«рЃљрЃџрЃў рЃўрЃюрЃЋрЃћрЃАрЃбрЃўрЃфрЃўрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃќрЃўрЃЊрЃЋрЃљрЃќрЃћ"- рЃЋрЃљрЃ«рЃбрЃљрЃюрЃњ рЃЉрЃћрЃЪрЃўрЃбрЃљрЃерЃЋрЃўрЃџрЃў;
- рЃЌрЃЉрЃўрЃџрЃўрЃАрЃерЃў Uber Georgia-рЃА рЃљрЃърЃџрЃўрЃЎрЃљрЃфрЃўрЃљ рЃљрЃЏрЃБрЃерЃљрЃЋрЃЊрЃљ;

рЃБрЃфрЃ«.рЃЊ.III.6.
рЃўрЃюрЃЊрЃўрЃЎрЃљрЃбрЃЮрЃарЃћрЃЉрЃў
- рЃюрЃљрЃфрЃюрЃЮрЃЉ рЃАрЃўрЃбрЃДрЃЋрЃћрЃЉрЃАрЃљ рЃЊрЃљ рЃўрЃџрЃБрЃАрЃбрЃарЃљрЃфрЃўрЃћрЃЉрЃќрЃћ рЃЊрЃљрЃДрЃарЃЊрЃюрЃЮрЃЉрЃўрЃЌ рЃљрЃЏрЃЮрЃўрЃфрЃюрЃЮрЃЉрЃА рЃЮрЃа-рЃАрЃљрЃЏрЃгрЃўрЃюрЃљрЃЊрЃљрЃЊрЃћрЃЉрЃўрЃљрЃюрЃў рЃЏрЃўрЃЎрЃарЃЮрЃбрЃћрЃЦрЃАрЃбрЃўрЃА рЃерЃўрЃюрЃљрЃљрЃарЃАрЃА;
- рЃЏрЃЮрЃАрЃЏрЃћрЃюрЃўрЃАрЃљрЃА рЃЊрЃљрЃЏрЃБрЃерЃљрЃЋрЃћрЃЉрЃБрЃџ рЃбрЃћрЃЦрЃАрЃбрЃерЃў рЃЏрЃЮрЃўрЃФрЃўрЃћрЃЉрЃА рЃюрЃљрЃфрЃюрЃЮрЃЉ рЃАрЃўрЃбрЃДрЃЋрЃћрЃЉрЃА рЃгрЃўрЃюрЃљрЃАрЃгрЃљрЃа рЃЏрЃўрЃфрЃћрЃЏрЃБрЃџрЃў рЃўрЃюрЃАрЃбрЃарЃБрЃЦрЃфрЃўрЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ (рЃЏрЃљрЃњ., рЃърЃћрЃарЃАрЃЮрЃюрЃљрЃЪрЃЌрЃљ рЃАрЃљрЃ«рЃћрЃџрЃћрЃЉрЃА, рЃАрЃљрЃЌрЃљрЃЏрЃљрЃерЃЮрЃћрЃЉрЃўрЃА рЃљрЃю рЃфрЃ«рЃЮрЃЋрЃћрЃџрЃћрЃЉрЃўрЃА рЃљрЃдрЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџ рЃАрЃўрЃбрЃДрЃЋрЃћрЃЉрЃА рЃЊрЃљ рЃљ.рЃе.);
- рЃбрЃћрЃЦрЃАрЃбрЃерЃў рЃърЃЮрЃБрЃџрЃЮрЃЉрЃА рЃўрЃџрЃБрЃАрЃбрЃарЃљрЃфрЃўрЃўрЃА рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃА рЃЏрЃЮрЃюрЃљрЃЎрЃЋрЃћрЃЌрЃА;
- рЃЏрЃЮрЃўрЃФрЃўрЃћрЃЉрЃА рЃбрЃћрЃЦрЃАрЃбрЃерЃў рЃЎрЃЮрЃюрЃЎрЃарЃћрЃбрЃБрЃџ рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃљрЃА (рЃЏрЃљрЃњ., рЃарЃЮрЃњрЃЮрЃарЃў, рЃЋрЃўрЃю, рЃарЃљ рЃцрЃћрЃарЃўрЃА, рЃарЃљрЃЏрЃЊрЃћрЃюрЃў);
- рЃбрЃћрЃЦрЃАрЃбрЃерЃў рЃЏрЃЮрЃфрЃћрЃЏрЃБрЃџ рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃљрЃќрЃћ рЃЊрЃљрЃДрЃарЃЊрЃюрЃЮрЃЉрЃўрЃЌ рЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃА рЃЎрЃЮрЃюрЃЎрЃарЃћрЃбрЃБрЃџ рЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃљрЃА (рЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃА рЃюрЃљрЃ«рЃљрЃбрЃА, рЃърЃЮрЃБрЃџрЃЮрЃЉрЃА рЃерЃћрЃАрЃљрЃбрЃДрЃЋрЃўрЃА рЃўрЃџрЃБрЃАрЃбрЃарЃљрЃфрЃўрЃљрЃА рЃЊрЃљ рЃАрЃ«рЃЋрЃљ).

рЃўрЃ«рЃўрЃџрЃћрЃЌ рЃЉрЃЏрЃБрЃџрЃў.
Рђб рЃърЃўрЃарЃљрЃЊрЃЮрЃЉрЃўрЃА рЃЊрЃљрЃЏрЃљрЃЊрЃљрЃАрЃбрЃБрЃарЃћрЃЉрЃћрЃџрЃў рЃЊрЃЮрЃЎрЃБрЃЏрЃћрЃюрЃбрЃў;
Рђб рЃ»рЃљрЃюрЃЏрЃарЃЌрЃћрЃџрЃЮрЃЉрЃўрЃА рЃЏрЃЊрЃњрЃЮрЃЏрЃљрЃарЃћрЃЮрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ рЃфрЃюрЃЮрЃЉрЃљ (рЃцрЃЮрЃарЃЏрЃљ IV 100/рЃљ);
Рђб рЃЊрЃљрЃЉрЃљрЃЊрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃгрЃЏрЃЮрЃЉрЃљ (рЃЊрЃћрЃЊрЃљрЃюрЃў рЃљрЃю рЃюрЃЮрЃбрЃљрЃарЃўрЃБрЃџрЃљрЃЊ рЃЊрЃљрЃЏрЃЮрЃгрЃЏрЃћрЃЉрЃБрЃџрЃў рЃљрЃАрЃџрЃў);
Рђб рЃЏрЃерЃЮрЃЉрЃћрЃџрЃў рЃљрЃю рЃЏрЃерЃЮрЃЉрЃџрЃўрЃА рЃюрЃЮрЃбрЃљрЃарЃўрЃБрЃџрЃў рЃгрЃћрЃАрЃўрЃЌ рЃЊрЃљрЃЏрЃЮрЃгрЃЏрЃћрЃЉрЃБрЃџрЃў рЃЌрЃљрЃюрЃ«рЃЏрЃЮрЃЉрЃљ;
Рђб рЃАрЃљрЃ»рЃљрЃарЃЮ рЃАрЃЎрЃЮрЃџрЃўрЃА рЃљрЃю рЃЏрЃФрЃдрЃЮрЃџрЃЌрЃљ рЃЏрЃЮрЃАрЃљрЃЏрЃќрЃљрЃЊрЃћрЃЉрЃћрЃџрЃў рЃЊрЃљрЃгрЃћрЃАрЃћрЃЉрЃБрЃџрЃћрЃЉрЃўрЃА (рЃљрЃЋрЃбрЃЮрЃАрЃЎрЃЮрЃџрЃљ) рЃЏрЃўрЃћрЃа рЃњрЃљрЃфрЃћрЃЏрЃБрЃџрЃў рЃЊрЃЮрЃЎрЃБрЃЏрЃћрЃюрЃбрЃў.
рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃљрЃќрЃћ рЃърЃўрЃарЃЋрЃћрЃџрЃљрЃЊрЃў рЃњрЃљрЃАрЃЋрЃџрЃўрЃА рЃАрЃљрЃцрЃљрЃАрЃБрЃарЃў рЃерЃћрЃљрЃЊрЃњрЃћрЃюрЃА 55 рЃџрЃљрЃарЃА (рЃЏрЃљрЃарЃЌрЃЋрЃўрЃА рЃЏрЃЮрЃгрЃЏрЃЮрЃЉрЃўрЃА рЃЊрЃљрЃЏрЃќрЃљрЃЊрЃћрЃЉрЃўрЃА рЃАрЃљрЃцрЃљрЃАрЃБрЃарЃў - 15 рЃџрЃљрЃарЃў, рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃљрЃќрЃћ рЃњрЃљрЃАрЃЋрЃџрЃўрЃА рЃАрЃљрЃцрЃљрЃАрЃБрЃарЃў - 40 рЃџрЃљрЃарЃў). рЃЌрЃћрЃЮрЃарЃўрЃБрЃџ рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃљрЃќрЃћ рЃерЃћрЃЏрЃЊрЃћрЃњрЃў рЃњрЃљрЃАрЃЋрЃџрЃўрЃА
... (2357 chars skipped) ... 
рЃю рЃБрЃцрЃџрЃћрЃЉрЃљ рЃљрЃЦрЃЋрЃА 365 рЃЎрЃљрЃџрЃћрЃюрЃЊрЃљрЃарЃБрЃџрЃў рЃЊрЃдрЃўрЃА рЃњрЃљрЃюрЃЏрЃљрЃЋрЃџрЃЮрЃЉрЃљрЃерЃў (рЃърЃўрЃарЃЋрЃћрЃџрЃљрЃЊрЃў рЃњрЃћрЃњрЃЏрЃўрЃБрЃарЃў рЃњрЃљрЃАрЃЋрЃџрЃљ - 15 рЃЎрЃљрЃџрЃћрЃюрЃЊрЃљрЃарЃБрЃџрЃў рЃЊрЃдрЃўрЃА рЃерЃћрЃЏрЃЊрЃћрЃњ, рЃ«рЃЮрЃџрЃЮ рЃерЃћрЃЏрЃЊрЃћрЃњрЃў рЃњрЃљрЃАрЃЋрЃџрЃћрЃЉрЃў 30 рЃЊрЃдрЃўрЃА рЃўрЃюрЃбрЃћрЃарЃЋрЃљрЃџрЃўрЃЌ) рЃЕрЃљрЃљрЃЉрЃљрЃарЃЮрЃА рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃБрЃџрЃў рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃА рЃЏрЃћрЃЮрЃарЃћ рЃћрЃбрЃљрЃърЃў.
* рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃБрЃџрЃў рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃА рЃЏрЃћрЃЮрЃарЃћ рЃћрЃбрЃљрЃърЃќрЃћ рЃњрЃћрЃњрЃЏрЃўрЃБрЃарЃў рЃњрЃљрЃАрЃЋрЃџрЃўрЃА рЃАрЃљрЃцрЃљрЃАрЃБрЃарЃў - 90 рЃџрЃљрЃарЃў.
